import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import map from './components/Maps/Map.js';
import navbars from './components/Bars/Navbars.js';
import lowerbar from './components/Bars/LowerBar.js';
import footer from './components/Footers/Footer.js';

function App() {
  return (
    <div className="App">
      <div className='navbars'>
        {navbars()}
      </div>
      <div className='map'>
        {map()}
      </div>
      <div style={{postion: "fixed", bottom: "0"}}>
        <div className='loswerbar'>
          {lowerbar()}
        </div>
        <div className='footer'>
          {footer()}
        </div>
      </div>
    </div>
  );
}

export default App;
